import React, { useEffect, useState } from 'react';
import Avatar from '@material-ui/core/Avatar';
import Button from '@material-ui/core/Button';
import CssBaseline from '@material-ui/core/CssBaseline';
import TextField from '@material-ui/core/TextField';
import Grid from '@material-ui/core/Grid';
import LockOutlinedIcon from '@material-ui/icons/LockOutlined';
import Typography from '@material-ui/core/Typography';
import { makeStyles } from '@material-ui/core/styles';
import Container from '@material-ui/core/Container';
import axios from 'axios'

const header = {withCredentials: true}
const UseStyles = makeStyles((theme) => ({
    paper: {
      marginTop: theme.spacing(8),
      display: 'flex',
      flexDirection: 'column',
      alignItems: 'center',
    },
    avatar: {
      margin: theme.spacing(1),
      backgroundColor: theme.palette.secondary.main,
    },
    form: {
      width: '100%', // Fix IE 11 issue.
      marginTop: theme.spacing(3),
    },
    submit: {
      margin: theme.spacing(3, 0, 2),
    },
  }));

function SignUp() {
    const classes = UseStyles();
    const [email, setEamil] = useState();
    const [password, setPassword] = useState();
    const [re_password, setRePassword] = useState();
    const [successLogin, setSuccessLogin] = useState(false);

    const sendParams = {
      header,
      Email: email,
      Password: password
    }

    const SignUpHandler = () => {
      if(email === '' || email === undefined){
        alert("이메일을 입력해 주세요");
      }
      else if(password === '' || password === undefined){
        alert("비밀번호를 입력해 주세요");
      }
      else if(re_password === '' || re_password === undefined){
        alert("비밀번호를 한번더 입력해 주세요");
      }
      else if(password !== re_password){
        alert("비밀번호가 일치하지 않습니다.");
      }
      else{
        /*async function signUpToServer(){
          const resData = await axios.post('http://localhost:3002/users/signup', sendParams)
          if(resData.data.message){
            alert(resData.data.message);
            if(resData.data.duplicate === '1'){
              setSuccessLogin(false);
            }
            else{
              setSuccessLogin(true);
            }
          }
          else{
            alert('회원 가입 실패!');
          }
        }signUpToServer();*/

        axios
          .post('http://localhost:3002/users/signup', sendParams)
          .then(res => {
            if(res.data.message){
              alert(res.data.message);
              if(res.data.duplicate === '1'){ // 이메일 중복
                setEamil('');
                setSuccessLogin(false);
              }
              else{ // 회원가입 성공
                setSuccessLogin(true);
              }
            }
            else{
              alert("회원 가입 실패");
            }
          })
          .catch(err => {
            console.log(err);
          })
        }
      }

    // useEffect(() => {
    //   async function fetchData(){
    //     const request =  await axios.get('http://localhost:3002/api')
    //     console.log(request);
    //     return request;
    //   }
    //   fetchData();
    // })

  return (
    <Container component="main" maxWidth="xs">
      <CssBaseline />
      <div className={classes.paper}>
        <Avatar className={classes.avatar}>
          <LockOutlinedIcon />
        </Avatar>
        <Typography component="h1" variant="h5">
          Sign up
        </Typography>
        <form className={classes.form} noValidate>
          <Grid container spacing={3}>            
            <Grid item xs={12}>
              <TextField
                variant="outlined"
                required
                fullWidth
                id="email"
                label="Email Address"
                name="email"
                autoComplete="email"
                onChange={res => setEamil(res.target.value)}
              />
            </Grid>
            <Grid item xs={12}>
              <TextField
                variant="outlined"
                required
                fullWidth
                name="password"
                label="Password"
                type="password"
                id="password"
                autoComplete="current-password"
                onChange={res => setPassword(res.target.value)}
              />
            </Grid>
            <Grid item xs={12}>
              <TextField
                variant="outlined"
                required
                fullWidth
                name="password"
                label="Password"
                type="password"
                id="password"
                autoComplete="current-password"
                onChange={res => setRePassword(res.target.value)}
              />
            </Grid>
          </Grid>
          <Button
            type="submit"
            fullWidth
            variant="contained"
            color="primary"
            className={classes.submit}
            onClick={SignUpHandler}  
            href='#'       
          >
            Sign Up
          </Button>
        </form>
      </div>
    </Container>
  );
}

export default SignUp
